export const intialState = {
    mainPosts: [
        {
            id: 1,
            User: {
                id: 1,
                nickname: "안수ㅎ환",
            },
            content: "게시글 #블라블라 #라블라블",
        },
    ],
};

const reducer = (state = intialState, action) => {
    switch (action.type) {
        default:
            return state;
    }
};

export default reducer;
